import './App.css'

import React, { Component } from 'react'

import Layout from './components/Layout/Layout'

class App extends Component {
  render() {
    return (
      <div>
        <Layout>
          <p>Layout child</p>
        </Layout>
      </div>
    )
  }
}

export default App
